    <script src="<?= base_url('assets/DataTables/datatables.min.js') ?>"></script>
    <script>
        const title = 'Biaya Kuliah <?= $mahasiswa['nama'] ?>';

        $(document).ready(() => {
            const table = $('#table').DataTable({
                buttons: [{
                        extend: 'copy',
                        title: title,
                    },
                    {
                        extend: 'excel',
                        title: title,
                    },
                    {
                        extend: 'pdf',
                        download: 'open',
                        title: title,
                        customize: function(doc) {
                            doc.content.splice(0, 0, {
                                alignment: 'center',
                                margin: [0, 0, 0, 12],
                                image: 'data:image/png;base64,',
                                width: 515,
                            });
                            doc.content[2].table.widths = ['5%', '12%', '*', '*', '*', '*', '*'];
                            doc.content[2].table.width = '100%';
                        }
                    },
                    {
                        extend: 'print',
                        title: title,
                    },
                ],
                columnDefs: [{
                    targets: [0],
                    orderable: false,
                    searchable: false,
                }],
                dom: 'Brt',
                order: [1, 'asc'],
            });

            table.on('order.dt search.dt', () => {
                let i = 1;

                table.cells(null, 0, {
                    order: 'applied',
                    search: 'applied',
                }).every(function(cell) {
                    this.data(i++);
                });
            }).draw();
        });
    </script>